import React from 'react';
import ProductShops from './ProductShops';

export default function Home({shops, cart, setCart, user, message, setMessage}) {
  return (
     <div className='container-fluid'>
       {message ? <h3 className='row-4 error'>{message}</h3> : null }
      <div className="container cont ">
        <div className="row">
         {shops.map((data, index)=> {return <div className="col-xs-12 col-sm-6 col-md-4 col-lg-3 cont" key={index}><ProductShops setMessage={setMessage} user={user} data={data} cart={cart} setCart={setCart} /></div>})} 
         </div>
      </div>
    </div> 
  )
}
